import { View,Text } from "react-native";



export default class Main extends Component{




    render(){
        return(
            <View style={{
                flexDirection:"column"
            }}>
                <View style={{
                    height:"5%",width:"100%",backgroundColor:"#880606",flexDirection:"row",justifyContent:"center",alignContent:"center",alignItems:"center"}}>
                        <Text style={{fontFamily:"YanoneKaffeesatz",fontWeight:"600",alignSelf:"center",color:"#ffffff",fontSize:22}}>WWW.EMAAN.EDU.PK</Text>

                </View>
            </View>
        );
    }

}
